import react from "react";

const Button = (props) => {
  const styles = {
    backgroundColor: "#62497d",
    color: "#dfdfdf",
    height: "5vh",
    width: "50%",
    fontSize: "3.5vw",
  };

  return (
    <button class="ui button" style={styles}>
      {props.name}
    </button>
  );
};

export default Button;
